   return (
      <div className="userinfo">
         <div>
            <Avatar>A</Avatar>
            <Typography.Text className="username">ABC</Typography.Text>
         </div>
         <Button ghost onClick={() => auth.signOut()}>
            Đăng xuất
         </Button>
      </div>
   );
}

export default UserInfo;
